import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.scss';
import { useState } from "react";
import reportWebVitals from './reportWebVitals';


function ChangeClass() {
  const [hidden1, setRight1] = useState("hidden");
  const [hidden2, setRight2] = useState("hidden");
  const [hidden3, setRight3] = useState("hidden");
  const [hidden4, setRight4] = useState("hidden");
  const [hidden5, setRight5] = useState("hidden");

  let score = 5;
  const newscore = score - 1;
  const handleClick = event => {
    event.currentTarget.classList.add('wrong');
    newscore;
  };

  function showResult() {
    const myResult = (
      <div className='quiz-app headline submit'>
        <h1>Вітаємо!</h1>
      <h2>Ваш результат: {newscore} - Відмінно!</h2>
      <button className='refresh-btn' onClick={refresh}>На Головну</button>
      </div>
    ); 
    const root = ReactDOM.createRoot(document.getElementById('root'));
    root.render(myResult);
  }

  function refresh () {
    window.location.reload();
  }



  return (
    <div className="quiz-app">
      <h1 className='headline'>Вікторина</h1>
      <ul>Яке місто є столицею України?
        <button className="" onClick={() => setRight1("right")}>Київ</button>
        <h2 className={`${hidden1}`}>Вірно!</h2>
        <button className='b' onClick={handleClick}>Анкара</button>
        <button className='c' onClick={handleClick}>Хокайдо</button>
        <button className='d' onClick={handleClick}>Янґон</button>
      </ul>
      <ul>Де живе Ілон Маск?
        <button className='a' onClick={handleClick}>В Преторії</button>
        <button className='b' onClick={() => setRight2("right")}>В Лос-Анджелесі</button>
        <h2 className={`${hidden2}`}>Вірно!</h2>
        <button className='c' onClick={handleClick}>В Полтаві</button>
        <button className='d' onClick={handleClick}>В Вінніпезі</button>
      </ul>
      <ul>Де вперше було помічено спалах коронавірусу?
        <button className='a' onClick={handleClick}>У місті Бидгощ, Польща</button>
        <button className='b' onClick={handleClick}>У місті Нью-Йорк, США</button>
        <button className='c' onClick={handleClick}>У місті Усурійськ, РФ</button>
        <button className='d' onClick={() => setRight3("right")}>У місці Ухань, КНР</button>
        <h2 className={`${hidden3}`}>Вірно!</h2>
      </ul>
      <ul>Коли було зафіксовано перший спалах коронавірусу?
        <button className='a' onClick={handleClick}> Початок 2019-го року</button>
        <button className='b' onClick={() => setRight4("right")}> Кінець 2019-го року</button>
        <h2 className={`${hidden4}`}>Вірно!</h2>
        <button className='c' onClick={handleClick}>Початок 2020-го року</button>
        <button className='d' onClick={handleClick}>Кінець 2020-го року</button>
      </ul>
      <ul>Яка страва є традиційною на День подяки в США?
        <button className='a' onClick={handleClick}>Морозиво</button>
        <button className='b' onClick={() => setRight5("right")}>Індичка</button>
        <h2 className={`${hidden5}`}>Вірно!</h2>
        <button className='c' onClick={handleClick}>Торт</button>
        <button className='d' onClick={handleClick}>Рисове рагу</button>
      </ul>
      <button className='submit' type='submit' onClick={showResult}>Завершити</button>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ChangeClass />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
